INSERT INTO TBL_822C86E50BE84592A79545CD6DBAB5C4 VALUES('ESP32-CAM Camera Module\u0009','26b6a020-5aeb-460a-884c-b9149550dfc5','2022-09-14','b4050f0b-dd94-453b-b413-e41454e98837','01e5f3b4-03b4-449b-a7da-6518cbc03729',NULL,'2022-09-14','ESP32-CAM Camera Module',NULL,'Beskrivelse\u000aESP32-CAM Camera Module. Dette modul kan bruges til meget! Med dens \u201cIndbygget\u201d camera er den perfekt til overv\u00e5gnings projekter.\u000a\u000aTekniske detaljer:\u000aFeatures:\u000aLow-power dual-core 32-bit CPU for application processors.\u000aMain frequency up to 240MHz, computing power up to 600 DMIPS.\u000aBuilt-in 520 KB SRAM, external 4M PSRAM.\u000aSupports interfaces such as UART/SPI/I2C/PWM/ADC/DAC.\u000aSupport OV2640 and OV7670 cameras, built-in flash.\u000aSupport image WiFi upload.\u000aSupport TF card.\u000aSupport multiple sleep modes.\u000aEmbedded Lwip and Free RTOS.\u000aSupport STA/AP/STA+AP working mode.\u000aSupport Smart Config/AirKiss one-click distribution network.\u000aSupport secondary development.\u000a\u000aSpecification:\u000aVoltage: 5V\u000aCurrent: 2A\u000aDimensions: 2.7x4cm/1.06\u00d71.57inch\u000a\u000aInfo: Modulet virker fint unden antenne, men det kan hj\u00e6lpe hvis wifi forbindelsen er d\u00e5rlig.\u000a\u000aSIM800 Antenne IPEX Connector',NULL,NULL,NULL,NULL)
