INSERT INTO TBL_822C86E50BE84592A79545CD6DBAB5C4 VALUES('NodeMcu WeMos Wifi ESP8266 + OLED 0.96\u2033','26b6a020-5aeb-460a-884c-b9149550dfc5','2022-09-14','9b3cf3ac-daa3-4f31-ba09-fdae1ec0cc4b','2848de60-2ddb-4560-870d-c8d5cc32230f',NULL,'2022-09-14','NodeMcu WeMos Wifi ESP8266 + OLED 0.96\u2033',NULL,'Beskrivelse\u000aNodeMcu WeMos Wifi ESP8266 ESP-12F CP2102 + OLED Development Board.\u000a\u000aTekniske detaljer:\u000aChip: ESP8266 (ESP-12F)\u000aPins: 12 digital pins write/read/interrupt/pwm/I2C/one-wire supported(except D0)\u000aAnalog: 1 analog input\u000aIntegrated 0.96 Prime; OLED\u000aMicro USB connection\u000aCompatible with Arduino\u000aCompatible with NodeMCU(Lua for ESP8266)\u000aInput Power 4.75V ~ 12V\u000aSize: 6.2\u00d72.7cm/2.44\u00d71.06inch\u000a\u000a',NULL,NULL,NULL,NULL)
INSERT INTO TBL_822C86E50BE84592A79545CD6DBAB5C4 VALUES('DHT-11 Digital Temperature and Humidity Module.','26b6a020-5aeb-460a-884c-b9149550dfc5','2022-09-14','5c58470d-7d72-42b1-9098-1f188950d244','28fd186c-fc8c-4c8b-9d94-cd7c8682681e',NULL,'2022-09-14','DHT-11 Digital Temperature and Humidity Module.',NULL,'Beskrivelse\u000aDHT-11 Digital Temperature and Humidity Module, er et module som kam m\u00e5le b\u00e5de luftfugtighed, og temperatur.\u000a\u000aTekniske detaljer:\u000aHumidity Range: 20-90% RH\u000aHumidity Accuracy: \u00b15% RH\u000aTemperature Range: 0-50 \u00b0C\u000aTemperature Accuracy: \u00b12% \u00b0C\u000aOperating Voltage: 3V to 5.5V\u000a\u000aInstallere DHT Library\u000aDownload library (Download)\u000aUdpak filer\u000aFlyt/kopir mappen \u201cDHT_sensor_library\u201d til  \u201clibraries\u201d som findes i \u201cArduino IDE\u201d mappen (C:Program Files (x86)Arduinolibraries)\u000a\u00c5ben Arduino IDE software og klik p\u00e5 \u201cSketch/Include library\u201d\u000aKlik nu p\u00e5 \u201cAdd Zip. library\u201d og find Zip filen du lige har downloaded.\u000a\u00c5ben \u201cManage\u201d for at opdatere library.\u000aLuk, og \u00e5ben Arduino IDE programmet. (Genstart programmet)\u000aNu er DHT library installeret\u000aEksempel\u000aHer viser vi et hurtig eksempel p\u00e5 hvordan du sammen s\u00e6tter dette modul til en \u201cArduino Uno R3\u201d, N\u00e5r temperatur, eller luftfugtighed overskrider max gr\u00e6nsen t\u00e6ndes der en LED.\u000a\u000aDu skal bruge:\u000a\u000aArduino Uno R3\u000aMini-B USB stik\u000aLED\u000aBreadboard',NULL,NULL,NULL,NULL)
