INSERT INTO TBL_822C86E50BE84592A79545CD6DBAB5C4 VALUES('Digitalt multimeter, bil\u000a','1960b408-0cb6-4d11-9cb7-e3c53bd07b80','2022-11-20','315d4352-1dbf-43c1-a1a3-9e73549475a3','36f96355-b026-4f2b-a854-f23576bc9f98',NULL,'2022-11-20','Digitalt multimeter, bil',NULL,'\u000aL\u00c6S MERE \u000a\u000aSpecialmultimeter med baggrundsbelyst display og udklappelig bordst\u00f8tte. M\u00e5ler sp\u00e6nding, str\u00f8mstyrke, frekvens, impulsforhold, kapacitans, modstand, temperatur samt diode- og forbindelsestest. \u000a\u000a\u000a\u000aBilspecifikke test omfatter omdrejningstal for to- og firetaktsmotorer op til 8 cylindre, pulsbreddem\u00e5ling (PWM) p\u00e5 f.eks. injektordyser og tomgangsmotor samt kamvinkel (dwell) for elektriske t\u00e6ndingssystemer og t\u00e6ndr\u00f8rselektroder.\u000a\u000a\u000a\u000aMultimeteret har valgfri funktioner til automatisk detektering af m\u00e5leomr\u00e5de, holdefunktion for nuv\u00e6rende v\u00e6rdi, sammenligning med gemt v\u00e6rdi (relativ v\u00e6rdi) samt batteristatusindikator og batterisparefunktion, som slukker enheden efter 30 minutter.\u000a\u000a\u000a\u000aCAT III 600 V: Til m\u00e5ling i distributionsnet og normale industrielle milj\u00f8er, s\u00e5 l\u00e6nge sp\u00e6ndingsklassifikationen er h\u00f8j nok til m\u00e5leopgaven\u000a\u000a\u000aTilbeh\u00f8r:\u000a\u000a1 stk. stoftaske\u000a\u000a1 stk. temperatursonde\u000a\u000a1 stk. induktiv tang til m\u00e5ling af omdrejningstal\u000a\u000a1 s\u00e6t testkabler\u000a\u000a\u000aM\u00e5lefrekvens\u00092 Hz (nominelt)\u000aOversp\u00e6ndingskategori\u0009CAT III 600V\u000aArbejdstemperatur\u00090\u201350 \u00b0C (<70 % RF)\u000aOpbevaringstemperatur\u0009-20\u201360 \u00b0C (<80 % RF)\u000aTemperatursensor\u0009Termoelement, type K\u000aM\u00e5leomr\u00e5de\u0009-20~760 \u00b0C (\u00b13 %)\u000aMotorspecifikke tests\u0009\u000aPulsbredde\u00091~10 ms\u000aOmdrejningstal\u0009300\u20134000 til 300\u20136000 rpm (2-takt)\u000aOmdrejningstal\u0009600\u20134000 til 600\u201312000 (4-takter)\u000aKamvinkel\u00090\u201390\u00ba (4 cyl.) til 0\u201345\u00ba (8 cyl.) (dwell-angle)\u000aDimensioner\u0009\u000aH\u00f8jde\u0009146 mm\u000aBredde\u000966,2 mm\u000aDybde\u000941,5 mm\u000aV\u00e6gt\u0009200 g\u000aBatteri\u0009\u000aBatteritype\u00096LR61, 9 V (ikke inkluderet)\u000aBatterisp\u00e6nding\u00091 x 9 V DC\u000aElektriske data\u0009\u000aKontinuitet\u0009<150 \u03a9 (<0,3 mA)\u000aDiodetest\u00090,3 mA (1,5 V DC \u00e5ben kreds)\u000aStr\u00f8mstyrke\u00090\u2013400 mA til 0\u201320 A (AC/DC)\u000aSp\u00e6ndingsomr\u00e5de\u00090\u2013400 mV til 0\u20131000 V (DC)\u000aSp\u00e6ndingsomr\u00e5de\u00090\u2013400 mV til 0\u2013700 V (AC)\u000aModstand\u00090\u2013400 \u03a9 til 0\u201340 M\u03a9\u000aKapacitans\u00090\u201350 nF til 0\u2013100 \u00b5F\u000aFrekvens\u00090\u20135 Hz til 0\u201310 MHz\u000aPulskvotient\u00090,1\u201399,9 %\u000a',NULL,NULL,NULL,NULL)
